import React from "react";
import "./hoem.css"; // Importe o arquivo CSS para aplicar estilos

function Home() {
  return (
    <div className="home-container">
      <h1>Bem-vindo à Página Inicial</h1>
      <p>Esta é a página inicial do nosso aplicativo.</p>
    </div>
  );
}

export default Home;
